def solve(list1, list2):
    result = []
    for i in list1:
        if type(i) == list:
            for j in i:
                if j in list2:
                    result.append(j)
        else:
            if i in list2:
                result.append(i)
    return result

def solve(nested_list, list):
    result = []

    for sublist in nested_list:
        for element in sublist:
            if element in list and element not in result:
                result.append(element)

    return result
